interface HeaderProps {
  onOpenNewTransactionModal: () => void;
}

export function Header( {onOpenNewTransactionModal} : HeaderProps ) {


  return (
    <Container>
      <Content>
        <img src={logoPng} alt="personalFinance" />
        <button type="button" onClick={onOpenNewTransactionModal}>
          Nova transação
        </button>

        
      </Content>
    </Container>
  );
}
